import React, { Component } from 'react';
import './nav.css';

import { Link } from 'react-router-dom'

export default class Nav extends Component {
    render() {
        return (
            <div className="navbar navbar-dark navbar-expand-lg bg-dark">
                <div className="container">
                    <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarTogglerDemo03" aria-controls="navbarTogglerDemo03" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>
                    <div className=" navbar-collapse" id="navbarTogglerDemo03">
                        <ul className="navbar-nav mr-auto mt-2 mt-lg-0">
                            <li className="nav-item">
                                <Link className="nav-link" to="/onecountry">Q1: One</Link>
                                <Link className="nav-link" to="/list">Q2: List</Link>
                                <Link className="nav-link" to={`/${'all'}`}>Q3: All</Link>
                                <Link className="nav-link" to="/all">Q4: Slot</Link>
                                <Link className="nav-link" to="/all">Q5: Form</Link>
                                <Link className="nav-link" to="/all">Q6: JWT</Link>
                            </li>
                        </ul>
                    </div>
                </div>
            </div>
        );
    }
}
